import React from "react";
import "./style.css";

function Title(props) {
  return (
    <div className="row" style={rowStyle}> 
      <div className="col-md-4">
        <h3> </h3>
      </div>
      <div className="col-md-4">
        <h3>{props.title}</h3>
      </div>
      <div className="col-md-4">
        <h3>{props.points} </h3>
      </div>
    </div>
  )
}
const rowStyle = {
  width: '100%',
  background: '#333',
  color: 'white'

}

export default Title;
